import React from 'react';
import DownloadButton from './DownloadButton';

function CodeBlock({ code }) {
    return (
        <div className="code-block-container">
            <pre><code>{code}</code></pre>
            <DownloadButton code={code} />
        </div>
    );
}

export default CodeBlock;
